INSERT INTO `books` (`book_id`, `title`, `author`, `publication_date`, `ISBN`, `quantity_available`, `photo`, `description`, `category_id`, `publisher_id`) VALUES
(1003, '1984', 'George Orwell', '2012-12-08', '978-3-16-148410-2', 3, , '\"1984\" by George Orwell is a dystopian novel set in a totalitarian society where the government manipulates truth and suppresses individuality. Protagonist Winston Smith rebels against Big Brother\'s surveillance but is eventually broken by the system\'s cruelty. The novel explores themes of control, manipulation, and the dangers of totalitarianism.', 3, 1);
INSERT INTO `books` (`book_id`, `title`, `author`, `publication_date`, `ISBN`, `quantity_available`, `photo`, `description`, `category_id`, `publisher_id`) VALUES
(1004, 'The Catcher in the Rye', 'J.D. Salinger', '2019-12-10', '978-3-16-148410-3', 2, , '\"The Catcher in the Rye\" follows Holden Caulfield, a disillusioned teenager expelled from school. He embarks on a journey through New York City, grappling with themes of identity, alienation, and the loss of innocence. The novel offers a timeless portrayal of teenage angst and the search for authenticity in a complex world.', 3, 1);
INSERT INTO `books` (`book_id`, `title`, `author`, `publication_date`, `ISBN`, `quantity_available`, `photo`, `description`, `category_id`, `publisher_id`) VALUES
(1023, 'Eleven Minutes', 'Paolo Coelho', '0000-00-00', '241212151', 8, , '\"Eleven Minutes\" is a novel written by Paulo Coelho. It tells the story of Maria, a young Brazilian girl who ventures to Switzerland in search of a better life. In her journey, she becomes a prostitute and experiences love, desire, and self-discovery, exploring the complexities of human relationships and sexuality.', 1, 1);
INSERT INTO `books` (`book_id`, `title`, `author`, `publication_date`, `ISBN`, `quantity_available`, `photo`, `description`, `category_id`, `publisher_id`) VALUES
(1024, 'To kill a mocking bird', 'Harper Lee', '0000-00-00', '646651515', 2, , '\"To Kill a Mockingbird\" is a classic novel written by Harper Lee. Set in the 1930s in the fictional town of Maycomb, Alabama, it follows the story of young Scout Finch and her brother Jem, whose father, Atticus Finch, is a principled lawyer defending a black man accused of raping a white woman. The novel addresses themes of racial injustice, moral courage, and the loss of innocence.', 2, 1);
INSERT INTO `books` (`book_id`, `title`, `author`, `publication_date`, `ISBN`, `quantity_available`, `photo`, `description`, `category_id`, `publisher_id`) VALUES
(1025, 'The Great Gatsby', 'F. Scott Fitzgerald', '0000-00-00', '54', 0, , '\"The Great Gatsby\" is a novel written by F. Scott Fitzgerald. Set in the Roaring Twenties, it follows the mysterious millionaire Jay Gatsby\'s extravagant lifestyle and his pursuit of the elusive Daisy Buchanan. Through themes of wealth, love, and social class, the novel explores the American Dream\'s disillusionment and the emptiness of the Jazz Age.', 2, 1);
INSERT INTO `books` (`book_id`, `title`, `author`, `publication_date`, `ISBN`, `quantity_available`, `photo`, `description`, `category_id`, `publisher_id`) VALUES
(1026, 'Gone Girl', 'Gillian Flynn', '0000-00-00', '645421241', 0, , '\"Gone Girl\" is a psychological thriller novel written by Gillian Flynn, published in 2012. The book tells the story of a husband\'s search for his missing wife and delves into themes of marriage, deception, and the complexities of human relationships.', 2, 1);
INSERT INTO `books` (`book_id`, `title`, `author`, `publication_date`, `ISBN`, `quantity_available`, `photo`, `description`, `category_id`, `publisher_id`) VALUES
(1027, 'Mistborn The Final Empire', 'Brandon Sanderson', '2014-11-12', '245454512', 15, , '\"Mistborn: The Final Empire\" is the first book in the Mistborn trilogy, written by Brandon Sanderson. It is a fantasy novel set in a unique and intricately crafted world with a magic system based on the manipulation of metals.', 2, 1);
INSERT INTO `books` (`book_id`, `title`, `author`, `publication_date`, `ISBN`, `quantity_available`, `photo`, `description`, `category_id`, `publisher_id`) VALUES
(1028, 'Norwegian Wood', 'Haruki Murakami', '2012-11-06', '26252135', 5, , '\r\n\"Norwegian Wood\" by Haruki Murakami is a haunting novel set in 1960s Tokyo. Toru Watanabe, the protagonist, navigates love, grief, and self-discovery after the suicide of his best friend. Emotionally resonant and introspective, the book explores the complexities of relationships and the profound impact of loss on young hearts.', 1, 1);
INSERT INTO `books` (`book_id`, `title`, `author`, `publication_date`, `ISBN`, `quantity_available`, `photo`, `description`, `category_id`, `publisher_id`) VALUES
(1029, 'The Book Thief', 'Markus Zusak', '0000-00-00', '213435213', 5, , '\"The Book Thief\" is a captivating historical novel by Markus Zusak, set in Nazi Germany. It follows the journey of Liesel Meminger, a young girl who finds solace and hope in stolen books during World War II, highlighting the power of words and humanity amidst darkness.', 1, 1);

